import anime from "animejs/lib/anime.es.js";
import React from "react";
let morphing = anime({
  targets: ".morph",
  d: [
    {
      value: "M 70.710678,404.03551 258.59905,63.6141 424.26407,392.92383 Z"
    },
    {
      value: "M 70.710678,404.03551 415.17269,299.9898 l 9.09138,92.93403 z"
    }
  ],
  easing: "easyInOutQuint",
  duration: 1400,
  autoplay: true,
  loop: true
});
const Animation = () => {
  return (
    <svg
      width="500px"
      height="500px"
      viewBox="0 0 500 500"
      preserveAspectRatio="none"
    >
      <path
        className="morph"
        d="M 70.710678,404.03551 258.59905,63.6141 424.26407,392.92383 Z"
      ></path>
    </svg>
  );
};

export default Animation;
